import { useState, useEffect, React } from "react";
import "../css/style.css";
import Swal from "sweetalert2";
import axios from "axios";
import { Link } from "react-router-dom";
import avatar1 from "../assets/avatar4.jpeg";
import { useLocation } from "react-router-dom";
function QAOrganizer() {
  const { search } = useLocation();
  const searchParams = new URLSearchParams(search);
  const email = searchParams.get("email");
  const [quality, setQuality] = useState([]);
  const loadQA = async () => {
    const qaResults = await axios.get("https://sxt9335.uta.cloud/viewQA.php");
    setQuality(qaResults.data.qaResults);
    console.log(qaResults.data.qaResults);
  };

  const handleQAEdit = (quality) => {
    window.location.href = `/editQA?email=${email}&policyId=${quality.policyId}&qaPolicies=${quality.qaPolicies}&year=${quality.year}`;
  };

  useEffect(() => {
    loadQA();
  }, []);

  const handleDelete = (policyId) => {
    // Send a request to the PHP backend to delete the course
    fetch("https://sxt9335.uta.cloud/deleteQA.php", {
      method: "POST",
      headers: {
        "Content-Type": "application/x-www-form-urlencoded",
      },
      body: `policyId=${policyId}`,
    })
      .then((response) => response.text())
      .then((data) => {
        if (data === "QA deleted successfully") {
          Swal.fire("Success!", "QA Deleted Successfully", "success").then(
            (result) => {
              if (result.isConfirmed) {
                window.location.href = `/QAOrganizer?email=${email}`;
              }
            }
          );
        } else {
          Swal.fire("Oops!", "Failed to delete user", "error");
        }
      })
      .catch((error) => {
        console.error("Error:", error);
        Swal.fire(
          "Success!",
          "An error occurred while deleting the user.",
          "success"
        );
      });
  };

  const [name, setName] = useState("");
  const loadPrograms = async () => {
    fetch("https://sxt9335.uta.cloud/getName.php", {
      method: "POST",
      headers: {
        "Content-Type": "application/x-www-form-urlencoded",
      },
      body: `email=${email}`,
    })
      .then((response) => response.text())
      .then((data) => {
        setName(data);
      })
      .catch((error) => {
        console.error("Error:", error);
      });
  };
  useEffect(() => {
    loadPrograms();
  }, []);
  return (
    <div className="stylecontainer">
      <div className="stylesidebar">
        <link
          rel="stylesheet"
          href="https://use.fontawesome.com/releases/v5.15.4/css/all.css"
          integrity="sha384-DyZ88mC6Up2uqS4h/KRgHuoeGwBcD4Ng9SiP4dIRy0EXTlnuz47vAwmeGwVChigm"
          crossOrigin="anonymous"
        />
        <ul>
          <li>
            <Link to="/home">
              <i className="fas fa-book"></i>
              <div className="styletitle">SkillBridge</div>
            </Link>
          </li>
          <li>
            <a href="#">
              <i className="fas fa-th-large"></i>
              <div className="styletitle">QA Dashboard</div>
            </a>
          </li>
          <li>
            <a href="#">
              <i className="fas fa-tag"></i>
              <div className="styletitle">Manage Profiles</div>
            </a>
          </li>
          <li>
            <a href="#">
              <i className="fas fa-tag"></i>
              <div className="styletitle">Trobleshoot Issues</div>
            </a>
          </li>
          <li>
            <a href="#">
              <i className="fas fa-tag"></i>
              <div className="styletitle">Grant Permissions</div>
            </a>
          </li>
          <li>
            <Link to={`/edit?email=${email}`}>
              <i className="fas fa-user"></i>
              <div className="styletitle">Edit Profile</div>
            </Link>
          </li>
          <li>
            <Link to={`/messagechat?name=${name}`}>
              <i className="fas fa-user"></i>
              <div className="styletitle">WebChat</div>
            </Link>
          </li>
          <li>
            <Link to="/login">
              <i className="fas fa-user"></i>
              <div className="styletitle">Logout</div>
            </Link>
          </li>
        </ul>
      </div>
      <div className="stylemain">
        <div className="styletop-bar">
          <div className="stylesearch">
            <input type="text" name="search" placeholder="Search here.." />
            <label htmlFor="search">
              <i className="fas fa-search"></i>
            </label>
          </div>
          <i className="fas fa-bell"></i>
          <div className="styleuser">
            <img src={avatar1} alt="skillbridge" />
          </div>
        </div>
        <div className="stylecards">
          <div className="stylecard">
            <div className="stylecard-content">
              <div className="stylenumber">25</div>
              <div className="stylecard-name">QA Policies</div>
            </div>
            <div className="styleicon-box">
              <i className="fas fa-tag"></i>
            </div>
          </div>
          <div className="stylecard">
            <div className="stylecard-content">
              <div className="stylenumber">23</div>
              <div className="stylecard-name">QA Processes</div>
            </div>
            <div className="styleicon-box">
              <i className="fas fa-tag"></i>
            </div>
          </div>
          <div className="stylecard">
            <div className="stylecard-content">
              <div className="stylenumber">5</div>
              <div className="stylecard-name">New Recommendations</div>
            </div>
            <div className="icon-box">
              <i className="fas fa-tag"></i>
            </div>
          </div>
          <div className="stylecard">
            <div className="stylecard-content">
              <div className="stylenumber">17</div>
              <div className="stylecard-name">Total Recommendations</div>
            </div>
            <div className="icon-box">
              <i className="fas fa-tag"></i>
            </div>
          </div>
        </div>
        <div className="styletables">
          <div className="StyleAllRoles">
            <div className="styleheading">
              <Link to={`/addQA?email=${email}`} className="stylebtn">
                Add Policy
              </Link>
              <h2>Manage Grades and Track Progress</h2>
              <a href="#" className="stylebtn">
                View All
              </a>
            </div>
            <table className="styleroles">
              <thead>
                <tr>
                  <th>S No</th>
                  <th>Policy ID</th>
                  <th>QA Policy and Process</th>
                  <th>Year Published</th>

                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {quality.map((res, index) => (
                  <tr key={index}>
                    <td>{index + 1}</td>
                    <td>{res.policyId}</td>
                    <td>{res.qaPolicies}</td>
                    <td>{res.year}</td>

                    <td>
                      <i className="fas fa-eye"></i>
                      &nbsp;
                      <i
                        className="fas fa-edit"
                        onClick={() => handleQAEdit(res)}
                      ></i>
                      &nbsp;
                      <i
                        className="fas fa-trash"
                        onClick={() => handleDelete(res.policyId)}
                      ></i>
                      &nbsp;
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
        <div className="stylefeedback">
          <div className="stylefeedback1">
            <h1>Email New Recommendations</h1>
            <form>
              <input type="text" placeholder="Subject" />
              <input type="email" placeholder="Email ID...." />
              <textarea placeholder="Email New Recommendations..."></textarea>
              <button type="submit">Send Recommendation</button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default QAOrganizer;
